import React from "react";
import { Backward, Forward } from "./Icons";

export const Navigator = ({ prev, next }) => {
  return (
    <>
      <button onClick={prev} className="prev">
        <Backward />
      </button>
      <button onClick={next} className="next">
        <Forward />
      </button>
    </>
  );
};
